# Mobx 

## mobx-react-devtools  

```bash
$ npm install mobx-react-devtools
```

```jsx
import React, { Component } from "react";
import DevTools from "mobx-react-devtools";

class App extends Component {
  render() {
    return <div>{process.env.NODE_ENV === "development" && <DevTools />}</div>;
  }
}

export default App;
```

-          .

## functional component mobx inject

React   mobx  inject    
   export  inject    .

### before

```jsx
const Component = inject("mobxStore")(
  observer(({ props }) => {
    // ....
  })
);

export default Component;
```

### better

```jsx
const Component = ({ props }) => {
  // ....
};

export default inject("mobxStore")(observer(Component));
```

#### or

```jsx
const Component = ({ props }) => {
  // ....
};

export default inject(({ mobxStore }) => ({
  mobxStore: mobxStore
}))(observer(Component));
```

## @observer , observer

@observable   component   props   @observer   

```jsx
const Component = ({ props }) => {
  return (
    //
  );
};

export default observer(Component)
```

## React render 

### list render  

#### Bad:

```jsx
@observer
class MyComponent extends Component {
  render() {
    const { todos, user } = this.props;
    return (
      <div>
        {user.name}
        <ul>
          {todos.map(todo => (
            <TodoView todo={todo} key={todo.id} />
          ))}
        </ul>
      </div>
    );
  }
}
```

#### Good:

```jsx
@observer class MyComponent extends Component {
    render() {
        const {todos, user} = this.props;
        return (<div>
            {user.name}
            <TodosView todos={todos} />
        </div>)
    }
}

@observer class TodosView extends Component {
    render() {
        const {todos} = this.props;
        return <ul>
            {todos.map(todo => <TodoView todo={todo} key={todo.id} />)}
        </ul>)
    }
}
```

- user.name       render     

### Index as a key is an anti-pattern

-   key   
-        .
- id    key   
  [index key ](https://medium.com/@robinpokorny/index-as-a-key-is-an-anti-pattern-e0349aece318)

### Dereference values late

-        .
-            

#### Bad

```jsx
<DisplayName name={person.name} />
```

#### Better

```jsx
<DisplayName person={person} />
```

-    , name     DisplayName          

###   

#### Bad :

```jsx
render() {
    return <MyWidget onClick={() => { alert('hi') }} />
}
```

#### Better :

```jsx
render() {
    return <MyWidget onClick={this.handleClick} />
}

handleClick = () => {
    alert('hi')
}
```

